import roadmap from '../images/roadmap.png';
import '../styles/Roadmap.css';

function Roadmap() {
  return (

    <div className="Roadmap">
      <header className="Roadmap-header">
      <hr style={{color: '#ffff02', width: 300}}/>
      <h1><br/><br/>Roadmap</h1>
        <p className="Peque"><b style={{color: '#ffff02'}}>SuperNovas NFTs</b>, where you can find aliens, zombies, robots and girls of different <b style={{color: '#f17123'}}>galaxies</b>. This voyage has a futuristic orientation, that aims to subdue different ways of integrating <b style={{color: '#f17123'}}>art, community and technology</b> in the fabulous NFT world. <br/><br/></p>
        <img src={roadmap} className="center" alt="Rats" style={{maxWidth: "1000px"}}/>
      </header><br/><br/><br/>
    </div>
  );
}

export default Roadmap;
